Step-by-step reasoning:
1. Psychological mechanisms: Responder behavior is thought to be driven by two factors. First, a self-interest component: people value the money they receive (split_self). Second, fairness concerns come into play; responders compare the offer (split_self) to what they consider a fair share based on their token contribution relative to the total tokens. When offers deviate from this fair benchmark, a penalty is applied.
2. Interaction of mechanisms: The fair share is computed as the proportion of tokens the participant secured (token_self relative to total tokens) multiplied by the combined earning. The difference between the offered share and this fair share is penalized (in absolute terms) because both offers that are “too low” and “too high” may trigger fairness concerns. The penalty is assumed to reduce the utility of accepting the offer.
3. Mathematical formulation: Let the fair share be given by 
  fair_share = (token_self/(token_self + token_opp)) × combined_earning.
Then, the utility is the linear benefit of the offered share, scaled by a self-interest weight (gamma), minus a penalty proportional to the absolute deviation from the fair share (absolute fairness violation), scaled by a fairness weight (delta).
4. Learnable parameters: The two learnable parameters are gamma (the weight on self-interest) and delta (the weight on fairness deviation). These parameters must be recoverable and are given generous numerical bounds.
5. Mapping to observables: The observable split_self represents the monetary offer. The token variables and combined_earning allow for computing the fair_share, which then determines the fairness adjustment in the utility.

Below is the formal specification.

<MODEL>
U_accept = gamma * split_self - delta * abs(split_self - ((token_self/(token_self + token_opp)) * combined_earning))
</MODEL>

